import "./App.css";

//importing Route and Routes from the React router library
import { Route, Routes } from "react-router-dom";

//import the HomePage 
import HomePage from "./pages/HomePage";

function App() {
  return (
    <ApolloProvider client={client}>
      <Routes>
        <Route path="/" element={<HomePage />} />
      </Routes>
    </ApolloProvider>
  );
}

export default App;
